#[cfg(feature = "32_bit_limbs")]
#[test]
fn test_limbs_div_limb_and_limbs_div_limb_in_place() {
    let test = |ns: &[Limb], d: Limb, q: &[Limb]| {
        assert_eq!(limbs_div_limb(ns, d), q);

        let mut ns = ns.to_vec();
        let ns_old = ns.clone();
        limbs_div_limb_in_place(&mut ns, d);
        assert_eq!(ns, q);

        let mut ns = ns_old;
        limbs_div_limb_in_place_alt(&mut ns, d);
        assert_eq!(ns, q);
    };
    test(&[0, 0], 2, &[0, 0]);
    test(&[6, 7], 1, &[6, 7]);
    test(&[6, 7], 2, &[0x8000_0003, 3]);
    test(&[100, 101, 102], 10, &[1_288_490_198, 858_993_469, 10]);
    test(&[123, 456], 789, &[2_482_262_467, 0]);
    test(&[0xffff_ffff, 0xffff_ffff], 2, &[0xffff_ffff, 0x7fff_ffff]);
    test(&[0xffff_ffff, 0xffff_ffff], 3, &[0x5555_5555, 0x5555_5555]);
}

