#[should_panic]
fn limbs_div_barrett_approx_fail_1() {
    let ns = &[1, 2];
    let ds = &[0x8000_0000];
    let mut scratch = vec![0; _limbs_div_barrett_approx_scratch_len(ns.len(), ds.len())];
    _limbs_div_barrett_approx(&mut [10, 10, 10], ns, ds, &mut scratch);
}

